import React from 'react';
import DataTable from 'react-data-table-component';
import data from '../Constant/GlobalData.json';
class UserData extends React.Component {

    render() {
        const columns = [
            {
                name: 'ID',
                selector: 'id',
                sortable: true,
            },
            {
                name: 'Name',
                selector: 'name',
                sortable: true,
            },
            {
                name: 'User Type',
                selector: 'user_type',
                sortable: true,
            },
            {
                name: 'Actions',
                selector: 'actions',
            }
          ];
        return (
            <div className="col-md-6 col-md-offset-3">
                <h2>User List</h2>
                <DataTable 
                columns={columns}
                data={data}
                />
            </div>
        )
    }
}

export default UserData;
